import React, {useEffect} from 'react'
// styles
import './Order.sass'
// components
import Destination from '../Order/Destination'
import Details from '../Order/Details'

function Order() {
	const [validClientInfo, setValidClientInfo] = useState(false)

	useEffect(() => {
		console.log(validClientInfo)
	}, [validClientInfo])

	return (
		<div className="order">
			<div className="order__container">
				<div className="order__info-block">
					<Destination checkValid={setValidClientInfo}/>
					<Details isValid={validClientInfo}/>
				</div>
			</div>
		</div>
	)
}

export default Order










